  char *new_str1 = strtok(str1, delim);
  char *new_str2 = s21_strtok(str2, delim);
  ck_assert_pstr_eq(new_str1, new_str2);
  new_str1 = strtok(NULL, delim);
  new_str2 = s21_strtok(NULL, delim);
  ck_assert_pstr_eq(new_str1, new_str2);
  new_str1 = strtok(NULL, delim);
